import React, { Component } from 'react';

class Attending extends Component {
  constructor(props) {
    super(props);
    this.state = {
    };
  }

  render() {
    const existingEvents = this.props.attending.map(event => (
      <span className="attendingTag" value={event}>{event}<img src="../close.svg" /></span>
    ));

    return (
      <div className="attendingEvents">
        <h3 className="attendingTitle">My Events: </h3>
        {existingEvents}
      </div>
    );
  }
}

export default Attending;
